import { React, useEffect, useState } from 'react';
import { useSelector } from 'react-redux';

const AdminDashboard = () => {

    const { restaurants } = useSelector(state => ({...state}));
    const [requests, setRequests] = useState('');

    useEffect(() => {
        setRequests(restaurant?.filter(rest => rest.status === 'requested'));
    }, [restaurant])

    return (
        <div className='container-fluid my-5 px-md-5'>
            <div className='row mt-5 pt-5 mx-md-2'>
                <div className='col-lg-8 col-10 offset-lg-2 offset-1 p-md-4 p-3 text-center shadow'>
                    <h3 className='text-center'>Admin Dashboard</h3>
                    <div className='row p-5'>
                        <h5 className='text-start'>New Restaurant Request</h5>
                        { requests?.length && requests.map(request => <div className='col-12 shadow'>
                            <span>{request.restaurantName}</span>
                        </div>)}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default AdminDashboard;
